    <style>
        svg#freepik_stories-people-search:not(.animated) .animable {
            opacity: 0;
        }

        svg#freepik_stories-people-search.animated #freepik--Page--inject-21 {
            animation: 6s Infinite linear heartbeat;
            animation-delay: 0s;
        }

        svg#freepik_stories-people-search.animated #freepik--Character--inject-21 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown, 1.5s Infinite linear shake;
            animation-delay: 0s, 1s;
        }

        @keyframes heartbeat {
            0% {
                transform: scale(1);
            }

            10% {
                transform: scale(1.1);
            }

            30% {
                transform: scale(1);
            }

            40% {
                transform: scale(1);
            }

            50% {
                transform: scale(1.1);
            }

            60% {
                transform: scale(1);
            }

            100% {
                transform: scale(1);
            }
        }

        @keyframes slideDown {
            0% {
                opacity: 0;
                transform: translateY(-30px);
            }

            100% {
                opacity: 1;
                transform: translateY(0);
            }
        }

        @keyframes shake {

            10%,
            90% {
                transform: translate3d(-1px, 0, 0);
            }

            20%,
            80% {
                transform: translate3d(2px, 0, 0);
            }

            30%,
            50%,
            70% {
                transform: translate3d(-4px, 0, 0);
            }

            40%,
            60% {
                transform: translate3d(4px, 0, 0);
            }
        }

